
class Solution(object):
    def findCircleNum(self, M):
        """
        :type M: List[List[int]]
        :rtype: int
        """
        # for row in M:
        #     print row
        linked = {str(x):[] for x in range(len(M))}
        for cur_person, row in enumerate(M):
            for other_person, isfriend in enumerate(row[:cur_person]):
                if isfriend:
                    if str(cur_person) in linked and str(other_person) in linked:
                        # print "A"
                        linked[str(other_person)].append(cur_person)
                        del linked[str(cur_person)]
                    elif str(cur_person) in linked and str(other_person) not in linked:
                        # print "B", cur_person, other_person
                        for k, v in linked.items():
                            if other_person in v and str(cur_person) != k:
                                linked[k].extend(linked[str(cur_person)])
                                linked[k].append(cur_person)
                                del linked[str(cur_person)]
                                break
                    elif str(cur_person) not in linked and str(other_person) in linked:
                        # print "C", cur_person, other_person
                        for k, v in linked.items():
                            if cur_person in v and str(other_person) != k:
                                linked[k].extend(linked[str(other_person)])
                                linked[k].append(other_person)
                                del linked[str(other_person)]
                                break
                    else:
                        # print "D"
                        for k, v in linked.items():
                            if cur_person in v:
                                current_link = k
                                break
                        for k, v in linked.items():
                            if other_person in v and k != current_link:
                                linked[k].extend(linked[current_link])
                                linked[k].append(int(current_link))
                                del linked[current_link]
                                break
                    # print linked
                            
        return len(linked)

